import React from "react";

const Header = ({ titulo, handleOnClick }) => {
  return (
    <div className="header">
      <div className="row">
        <h1 className="col-4">{titulo}</h1>
        <button onClick={handleOnClick} className="col-4">
          Agregar
        </button>
      </div>
    </div>
  );
};

export { Header };
